document.addEventListener('DOMContentLoaded', function() {
    const productsContainer = document.getElementById('products-container');
    const paginationContainer = document.querySelector('.pagination');

    const urlParams = new URLSearchParams(window.location.search);
    let currentPage = parseInt(urlParams.get('page')) || 1;
    const itemsPerPage = parseInt(urlParams.get('limit')) || 8;
    const searchQuery = urlParams.get('search') || '';


    const notFound = `
    <center>
    <div class="container d-flex justify-content-center align-items-center" style="min-height: 30px" >
        <div class="centered-content">
            <!-- SVG Content -->
            <svg width="75" height="99" viewBox="0 0 107 142" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
            <path d="M9.76494 42.4879C10.1335 38.0836 13.8157 34.6967 18.2353 34.6967H86.4463C90.7903 34.6967 94.4353 37.9721 94.898 42.2914L104.323 130.291C104.861 135.315 100.924 139.697 95.8717 139.697H10.8717C5.89773 139.697 1.98656 135.445 2.40133 130.488L9.76494 42.4879Z" fill="#00CC66" stroke="#006633" stroke-width="3"/>
            <rect x="22" y="63.1967" width="60" height="58" fill="url(#pattern0_493_231)"/>
            <circle cx="32.5" cy="45.6967" r="3.5" fill="white" stroke="#006633" stroke-width="2"/>
            <circle cx="72.5" cy="45.6967" r="3.5" fill="white" stroke="#006633" stroke-width="2"/>
            <path d="M32.5 42.1966C39 11.8633 55.9 -30.6034 71.5 42.1966" stroke="#006633" stroke-width="3"/>
            <defs>
            <pattern id="pattern0_493_231" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlink:href="#image0_493_231" transform="matrix(0.000696864 0 0 0.000720894 0 -0.0125556)"/>
            </pattern>
            <image id="image0_493_231" width="1435" height="1422" xlink:href="data:image/png;base64,"/>
            </defs>
            </svg>
                     
            
            <!-- Heading -->
            <h4 class="mt-3">Tidak ada merchandise<br>yang sesuai</h4>
            
            <!-- Button -->
            <button class="btn btn-success mt-3"><a style="text-decoration: none; color: inherit" href="${baseUrl}">Reset Pencarian</a></button>
        </div>
    </div>
    </center>
`;


    function fetchProducts(page = 1, search = '') {
        injectLoader('products-container');

        fetch(`api/products?page=${page}&limit=${itemsPerPage}&search=${search}`)
            .then(response => response.json())
            .then(data => {
                
                removeLoader('products-container');
                updatePagination(data.current_page, data.total_pages);
                updateProducts(data.products);

            })
            .catch(error => console.error('Error fetching products:', error));

    }

    function updateProducts(products) {
        productsContainer.innerHTML = '';
    
        const filledStar = `
        <svg class="star" width="15" height="14" viewBox="0 0 20 19" fill="none" xmlns="http://www.w3.org/2000/svg" style="margin-right: 2px;">
          <path d="M10.1304 0L12.4293 7.07548H19.8689L13.8501 11.4484L16.1491 18.5238L10.1304 14.151L4.11159 18.5238L6.41055 11.4484L0.391793 7.07548H7.83139L10.1304 0Z" fill="#FFC100"/>
        </svg>`;
        
        const unfilledStar = `
        <svg width="15" height="14" viewBox="0 0 20 19" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M9.76121 0L12.0602 7.07548H19.4998L13.481 11.4484L15.78 18.5238L9.76121 14.151L3.74245 18.5238L6.04141 11.4484L0.0226526 7.07548H7.46225L9.76121 0Z" fill="#D9D9D9"/>
        </svg>
`;
        
        const officialMerchHeading = document.getElementById("official-merch-heading");
        

        if (products.length < 1) {
            productsContainer.insertAdjacentHTML('beforeend', notFound);
            officialMerchHeading.style.visibility = "hidden"; // Hide the element
            paginationContainer.innerHTML = '';
        } else {
            officialMerchHeading.style.visibility = "visible"; // Unhide the element
        }
        

        products.forEach(product => {
            // Ensure avg_price and discount_value are numbers
            const avgPrice = parseFloat(product.avg_price);
            const discountValue = parseFloat(product.discount_value);
        
            // Initialize discountLabel variable
            let discountLabel = '';
        
            // Check if there's a discount and create the discount label
            if (discountValue > 0) {
                discountLabel = `
                <div class="discount-label">
                    <svg class="svg-image" viewBox="0 0 79 54" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <path d="M78.988 29.9637L65.3345 53.6189L65.334 29.9638L78.988 29.9637Z" fill="#830D0B"/>
                        <path d="M0 0H79V30H0L11 15L0 0Z" fill="#D7211E"/>
                    </svg>
                    <div class="overlay-text">${discountValue.toFixed()}%</div>
                </div>
                `;
            }
        
            // Calculate discounted price
            const discountedPrice = (avgPrice * (1 - discountValue / 100)).toFixed(2);
        
            // Create star rating HTML
            let starRatingHTML = '';
            const fullStars = Math.floor(product.avg_rating);
            const halfStar = product.avg_rating % 1 !== 0;
            const emptyStars = 5 - fullStars - (halfStar ? 1 : 0);
        
            for (let i = 0; i < fullStars; i++) {
                starRatingHTML += filledStar;
            }
            if (halfStar) {
                starRatingHTML += `<svg class="star" width="15" height="14" viewBox="0 0 20 19" fill="none" xmlns="http://www.w3.org/2000/svg" style="margin-right: 2px;">
                    <path d="M10.1304 0L12.4293 7.07548H19.8689L13.8501 11.4484L16.1491 18.5238L10.1304 14.151L4.11159 18.5238L6.41055 11.4484L0.391793 7.07548H7.83139L10.1304 0Z" fill="#FFC100" style="clip-path: inset(0 50% 0 0);"/>
                </svg>`;
            }
            for (let i = 0; i < emptyStars; i++) {
                starRatingHTML += unfilledStar;
            }
            if (product.product_image.includes('public/storage/')) {
                product.product_image = baseUrl + product.product_image;
            }

            // Create the product HTML
            const productHTML = `
            <div class="col-6 col-md-3 product-card-container">
            <div class="card product-card">
                ${discountLabel}
                <a href="${baseUrl}product/${product.id_product}" style="text-decoration: none; color: inherit;">
                    <div class="img-container">
                        <img src="${product.product_image}" class="card-img-top img-fluid" alt="${product.product_name}">
                    </div>
                    <div class="card-body">
                        <div class="d-flex flex-row mb-2 review-rating">
                            ${starRatingHTML}
                        </div>
                        <p class="card-text">
                            ${product.product_name}<br>
                            <span style="font-weight: bold;">Rp ${formatPriceValue(removeTrailingZeros(discountedPrice))}</span>
                            ${discountValue > 0 ? `<br><span style="text-decoration: line-through; color: #888;">Rp ${formatPriceValue(removeTrailingZeros(avgPrice.toFixed(2)))}</span>` : ''}
                        </p>
                    </div>
                </a>
            </div>
        </div>
            `;
        
            // Insert the product HTML into the container
            productsContainer.insertAdjacentHTML('beforeend', productHTML);
        });
        
        
    }
    
    function updatePagination(currentPage, totalPages) {
        paginationContainer.innerHTML = '';

        const prevPage = currentPage > 1 ? currentPage - 1 : null;
        if (prevPage) {
            paginationContainer.insertAdjacentHTML('beforeend', `<li class="page-item"><a class="page-link" href="#" onclick="changePage(${prevPage})">&lt;</a></li>`);
        } else {
            paginationContainer.insertAdjacentHTML('beforeend', `<li class="page-item disabled"><a class="page-link">&lt;</a></li>`);
        }

        for (let i = 1; i <= totalPages; i++) {
            const activeClass = i === currentPage ? ' active' : '';
            paginationContainer.insertAdjacentHTML('beforeend', `<li class="page-item${activeClass}"><a class="page-link" href="#" onclick="changePage(${i})">${i}</a></li>`);
        }

        const nextPage = currentPage < totalPages ? currentPage + 1 : null;
        if (nextPage) {
            paginationContainer.insertAdjacentHTML('beforeend', `<li class="page-item"><a class="page-link" href="#" onclick="changePage(${nextPage})">&gt;</a></li>`);
        } else {
            paginationContainer.insertAdjacentHTML('beforeend', `<li class="page-item disabled"><a class="page-link">&gt;</a></li>`);
        }
    }

    window.changePage = function(page) {
        currentPage = page;
        const newUrl = new URL(window.location.href);
        newUrl.searchParams.set('page', page);
        window.history.pushState({}, '', newUrl);
        fetchProducts(page, searchQuery);
    }

    // Initial fetch
    fetchProducts(currentPage, searchQuery);



    let reviewsContainer = document.getElementById("reviews-container");
    function fetchReviews(){
        injectLoader('reviews-container');
        fetch(`api/reviews`)
        .then(response => response.json())
        .then(data => {
            removeLoader('reviews-container');
            
            updateReviews(data.reviews);
        })
        .catch(error => console.error('Error fetching products:', error));
    }

    function updateReviews(reviews){

        function censorName(name) {
            // Split the name into parts (words)
            const parts = name.split(' ');
        
            // Censor each part of the name
            const censoredParts = parts.map(part => {
                // Keep the first letter and replace the rest with asterisks
                return part[0] + '*'.repeat(part.length - 1);
            });
        
            // Join the censored parts back into a single string
            return censoredParts.join(' ');
        }
        

        let profilePicture = reviews.profile_picture ?? "https://static.vecteezy.com/system/resources/thumbnails/009/292/244/small/default-avatar-icon-of-social-media-user-vector.jpg";

        reviews.reverse()

        reviews.forEach(review => {
            let name = (review.full_name.length > 0) ? review.full_name : review.username;
            
            if (review.anonymity === 1){
                name = censorName(name);
                profilePicture = "https://static.vecteezy.com/system/resources/thumbnails/009/292/244/small/default-avatar-icon-of-social-media-user-vector.jpg";

            }
        
            let reviewImages = ''; // Ensure reviewImages is initialized

            // Create review images HTML
            review.images.forEach(image => {
                reviewImages += `
                <div class="review-product-image">
                    <img src="${image.image_url}" alt="Product Image">
                </div>
                `;
            });

            // Escape HTML special characters in the comment
            let comment = escapeHtml(review.comment);

            let stars = '';
            stars += ('&#9733;'.repeat(review.rating));
            stars += ('&#9734;'.repeat(5 - review.rating));




            variation_name = review.variations.map(variation => variation.variation_name).join(', ');


            // Create review HTML
            let reviewHtml = `
                <div class="review-card">
                    <div class="review-image">
                        <img src="${profilePicture}" alt="User Image">
                    </div>
                    <div class="review-details">
                        <h5>${name}<span class="review-rating">${stars}</span></h5>
                        <div class="review-date">${review.date_posted}</div>
                        <div class="review-product"><span style="font-weight: bold;">Barang</span>: ${review.product_name}<br><span style="font-weight: bold;">Variasi:</span>: ${variation_name}</div>
                        <div class="review-text">${comment}</div>
                    </div>
                    ${reviewImages}
                </div>
            `;

            // Insert the review HTML into the container
            reviewsContainer.insertAdjacentHTML("beforeend", reviewHtml);

        })

    }

    fetchReviews();

});
